import { Link } from "react-router-dom";
import "../css/navigation.css";
import logo from "../logos/bransome3.png";
const Navigation = () => {
  return (
    <nav id="nav_box">
      <header className="nav-logo">
        <Link to="/">
          <img src={logo} />
        </Link>
      </header>
      <ul className="nav_links">
        <li className="nav-item">
          <Link to="/" className="nav_home_btn">
            Home
          </Link>
        </li>
        <li className="nav-item">
          <Link to="/brand" className="nav_brand_btn">
            Brands
          </Link>
        </li>
        <li className="nav-item">
          <Link to="/best20" className="nav_best_btn">
            Best20
          </Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
